<node ID="7579C212-BD96-4A91-8563-30634CEAECF0" TEXT="&#36807;&#31243;" COLOR="#344853" POSITION="left" STYLE="fork"><edge COLOR="#FCB60D" WIDTH="4" /><font NAME="PingFangSC-Regular" SIZE="18" /><node ID="3EAB5BE5-5E66-4A8C-9049-3C13873AC930" TEXT="&#26410;&#20351;&#29992; cdn" COLOR="#344853" POSITION="left" STYLE="fork"><edge COLOR="#FCB60D" WIDTH="3" /><font NAME="PingFangSC-Regular" SIZE="18" /><richcontent TYPE="NOTE"><html><head></head>
<body><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		1) 用户输入访问的域名,操作系统向 LocalDns 查询域名的ip地址.</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		2) LocalDns向 ROOT DNS 查询域名的授权服务器(这里假设LocalDns缓存过期)</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		3) ROOT DNS将域名授权dns记录回应给 LocalDns</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		4) LocalDns得到域名的授权dns记录后,继续向域名授权dns查询域名的ip地址</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		5) 域名授权dns 查询域名记录后，回应给 LocalDns</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		6) LocalDns 将得到的域名ip地址，回应给 用户端</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		7) 用户得到域名ip地址后，访问站点服务器</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		8) 站点服务器应答请求，将内容返回给客户端</p></body>
</html>
</richcontent>
</node>
<node ID="ECEA38D0-D9A1-406F-B206-55A5F10413B9" TEXT="&#20351;&#29992; cdn" COLOR="#344853" POSITION="left" STYLE="fork"><edge COLOR="#FCB60D" WIDTH="3" /><font NAME="PingFangSC-Regular" SIZE="18" /><richcontent TYPE="NOTE"><html><head></head>
<body><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		1) 用户输入访问的域名,操作系统向 LocalDns 查询域名的ip地址.</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		2) LocalDns向 ROOT DNS 查询域名的授权服务器(这里假设LocalDns缓存过期)</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		3) ROOT DNS将域名授权dns记录回应给 LocalDns</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		4) LocalDns得到域名的授权dns记录后,继续向域名授权dns查询域名的ip地址</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		5) 域名授权dns 查询域名记录后(一般是CNAME)，回应给 LocalDns</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		6) LocalDns 得到域名记录后,向CDN智能DNS查询域名的ip地址</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		7) CDN智能DNS 根据一定的算法和策略(比如静态拓扑，容量等),将最适合的CDN节点ip地址回应给 LocalDns</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		8) LocalDns 将得到的域名ip地址，回应给 用户端</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		9) 用户得到域名ip地址后，访问CDN节点服务器</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		10) CDN节点服务器判断本地缓存是否失效，如果缓存失效则访问站点服务器，重新拉去内容，并缓存在本地备用</p><p style='color: rgba(0, 0, 0, 0.600000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>		11) CDN节点服务器应答请求，将内容返回给客户端</p></body>
</html>
</richcontent>
</node>
</node>
<node ID="537E1DF7-5A94-47B1-9EBC-FCC5A15D85BB" TEXT="&#20851;&#38190;&#25216;&#26415;" COLOR="#344853" POSITION="left" STYLE="fork"><edge COLOR="#FCB60D" WIDTH="4" /><font NAME="PingFangSC-Regular" SIZE="18" /><node ID="89B10FEB-880E-4EE4-BBBF-D8E8690E3515" TEXT="&#20869;&#23481;&#36335;&#30001;" COLOR="#344853" POSITION="left" STYLE="fork"><edge COLOR="#FCB60D" WIDTH="3" /><font NAME="PingFangSC-Regular" SIZE="18" /><richcontent TYPE="NOTE"><html><head></head>
<body><p><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>内容路由功能是由</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>CDN</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>负载均衡系统来实现的。它的作用是将用户的请求导向整个</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>CDN</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>网络中的最佳节点，最佳节点可以是最近节点，延时最低节点等等，负载均衡的准确性和效率直接决定了整个</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>CDN</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>的效率和性能。</span></p></body>
</html>
</richcontent>
