<node ID="0BF99B31-EC66-4607-8C23-0BFE08040171" TEXT="&#26412;&#22320;&#36127;&#36733;&#22343;&#34913;&#65288;SLB&#65289;" COLOR="#344853" POSITION="left" STYLE="fork"><edge COLOR="#FCB60D" WIDTH="2" /><font NAME="PingFangSC-Regular" SIZE="18" /><node ID="1DEB4737-7976-4BFC-8DF2-B7CA91F16107" TEXT="&#26412;&#22320;&#36127;&#36733;&#22343;&#34913;&#65288;SLB&#65289;&#19968;&#33324;&#23616;&#38480;&#20110;&#19968;&#23450;&#30340;&#21306;&#22495;&#33539;&#22260;&#20869;&#65292;&#20854;&#30446;&#26631;&#26159;&#22312;&#29305;&#23450;&#30340;&#21306;&#22495;&#33539;&#22260;&#20869;&#23547;&#25214;&#19968;&#21488;&#26368;&#36866;&#21512;&#30340;&#33410;&#28857;&#25552;&#20379;&#26381;&#21153;" COLOR="#344853" POSITION="left" STYLE="fork"><edge COLOR="#FCB60D" WIDTH="1" /><font NAME="PingFangSC-Regular" SIZE="18" /><richcontent TYPE="NOTE"><html><head></head>
<body><p style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>因此，CDN节点的健康性、负载情况、支持的媒体格式等运行状态是本地负载均衡进行决策的主要依据。</p></body>
</html>
