<body><p><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>内容分发是指将内容从源站发送到</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>CDN</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>边缘的</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>Cache</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>的过程。目前主要有两种主流的内容分发技术：</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>PUSH</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>（分发）、</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>PULL</span><span style='color: rgba(0, 0, 0, 0.600000); font: 16px "PingFang SC"; -cocoa-font-postscriptname: "PingFangSC-Regular"; '>（回源）</span></p></body>
</html>
</richcontent>
